    console.log(typeof(bstyle), `${styles.bstyle}`);


    return(
        <button 
            className={styles[this.props.ButtonStyle]}            
            onClick={props.onClick}
            type={props.type || "button"}>
                {props.name} {props.children}
        </button>
    );
}

export default Button;
